def prime_divisors(n):

    divs = []
    pos = 0
    lp = len(primes)
    while n > 1 or pos < lp:

        while n % primes[pos] == 0:
            divs.append(primes[pos])
            n = n // primes[pos]

        pos += 1

    if n > 1:
        print('no more prime numbers in table')
        return False

    return divs


def divisors(n):

    divs = [1]
    for d in range(2, n//2+1):
        if n % d == 0:
            divs.append(d)

    divs.append(n)
    return divs


